const SlotDetails = ({ slot }) => {
    return (
        <div className="slotDetails">
            <h4>{slot.module}</h4>
            <p>{slot.lessonType}</p>
            <p>{slot.classNo}</p>
            <p>{slot.day}</p>
            <p>{slot.startTime}</p>
            <p>{slot.endTime}</p>
            <p>{slot.weeks}</p>
        </div>
    )
}

export default SlotDetails;
